[{"location":"#MetadataArrays","page":"Introduction","title":"MetadataArrays","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Modules = [MetadataArrays]","category":"page"},{"location":"#MetadataArrays.MetadataArray-Tuple{AbstractArray, Union{AbstractDict{String}, AbstractDict{Symbol}, NamedTuple}}","page":"Introduction","title":"MetadataArrays.MetadataArray","text":"MetadataArray(parent::AbstractArray, metadata)\n\nCustom AbstractArray object to store an AbstractArray parent as well as some metadata.\n\nExamples\n\njulia> v = [\"John\", \"John\", \"Jane\", \"Louise\"];\n\njulia> mdv = MetadataArray(v, groups = Dict(\"John\" => \"Treatment\", \"Louise\" => \"Placebo\", \"Jane\" => \"Placebo\"))\n4-element MetadataVector{String, Vector{String}, NamedTuple{(:groups,), Tuple{Dict{String, String}}}}:\n \"John\"\n \"John\"\n \"Jane\"\n \"Louise\"\n\njulia> metadata(mdv, :groups)\nDict{String, String} with 3 entries:\n  \"John\"   => \"Treatment\"\n  \"Jane\"   => \"Placebo\"\n  \"Louise\" => \"Placebo\"\n\n\n\n\n\n\n","category":"method"},{"location":"#MetadataArrays.MetadataArrayStyle","page":"Introduction","title":"MetadataArrays.MetadataArrayStyle","text":"MetadataArrays.MetadataArrayStyle{S}\n\nSubtype of BroadcastStyle for MetadataArray, where S is the BroadcastStyle of the parent array. This helps extract, combine, and propagate metadata from arrays.\n\n\n\n\n\n","category":"type"},{"location":"#MetadataArrays.MetadataMatrix","page":"Introduction","title":"MetadataArrays.MetadataMatrix","text":"MetadataMatrix\n\nShorthand for MetadataVector{T,P<:AbstractArray{T,2},M}.\n\nSee also: MetadataArray, MetadataMatrix\n\n\n\n\n\n","category":"type"},{"location":"#MetadataArrays.MetadataVector","page":"Introduction","title":"MetadataArrays.MetadataVector","text":"MetadataVector\n\nShorthand for MetadataVector{T,P<:AbstractArray{T,1},M}.\n\nSee also: MetadataArray, MetadataMatrix\n\n\n\n\n\n","category":"type"}]
